  [],\n\t\"revision_timestamp\": \"2016-02-26T22:14:31.501800\",\n\t\"name\": \"great-lakes-surface-ice-reports-from-u-s-coast-guard-f7078\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Data consist of ice observations from U.S.
  Coast Guard vessels operating on the Great Lakes, and from Coast Guard shore stations
  reported via teletype messages and ice logging forms. Observations include ice thickness
  and concentration, weather conditions, and ice breaking activity. Data from 1961/1962
  through 1966/1967 have been processed to a standard format and sorted by year and
  stations, and are available via FTP as ASCII files, one for each of the five lakes.
  These data were provided to NSIDC by the NOAA Great Lakes Environmental Research
  Laboratory (GLERL), along with documentation. The documentation, Great Lakes Environmental
  Research Laboratory Great Lakes Surface Ice Reports, 1961-1966, is included here.
  Data from 1970/1971 through 1993/1994 are available on microfilm. The original ice
  reporting forms for these years were filed as part of the ice operations files of
  the Ninth District U.S. Coast Guard Ice Navigation Center, Cleveland, OH. Data from
  1994/1995 through 2003/2004 are available via FTP in a single .tar file for each
  ice season.Note that no editing or quality control has been performed on this data
  set. Microfilmed records are difficult to use, as they are sorted by date and time
  only, and contain extraneous information. The electronic data from 1994/1995 forward
  are raw teletype reports. These are not in a consistent format, and also contain
  extraneous information. NSIDC obtained these data from a NOAA National Weather Service
  public FTP server. The National Weather Service obtained the data from the United
  States Coast Guard Headquarters. NSIDC was unable to locate a responsible party
  within NOAA who could provide NSIDC with a new source for the data. Therefore, the
  records end in 2004. Users may wish to contact the U.S. Coast Guard for information
  on obtaining the individual ship reports.\",\n\t\"license_title\": \"License Not
